class Content extends Component {
    constructor(props) {
        super(props);
        this.state = {
            data: Data,
            toBasket: [],
            searchResultsToFilter: ""
        };

        this.filterData = this.filterData.bind(this);
    }

    sendToCart = product => {
        this.state.toBasket.push(product);
    };
    searchRes = str => {
        this.state.searchResultsToFilter = str;
        // console.log(this.state.searchResultsToFilter);
    };
    filterData = (filteredData) => {
        // console.log('click', filteredData);
        this.setState({data: filteredData});
    };

    render() {
        return (
            <section className="content">
                <div className="container">
                    <div className="row">
                        <Categories toCart = {this.state.toBasket}/>
                    </div>
                    <div className="row">
                        <Search results = {this.searchRes}/>
                    </div>
                    <div className="row">
                        <div className="col-md-3">
                            <Filters data = {this.state.data} filterData = {this.filterData}/>
                        </div>
                        <div className="col-md-9">
                            <ProductList data= {this.state.data} toCart = {this.sendToCart} resProd = {this.state.searchResultsToFilter}/>
                        </div>
                    </div>
                </div>
            </section>
        );
    }
}

export default Content;
